import React from 'react'
import classes from './Header.module.css';

const Header = (props) => {
  return (
    <React.Fragment>
      <header className={classes.header}>
        <h1>React</h1>
      </header>
      <div className={classes.mainImage}>
          <img />
        </div>
    </React.Fragment>
  )
}

export default Header;
